    false,nt"url": null,nt"notes": "HOPWA Performance Profiles are generated
    quarterly for all agencies receiving HOPWA formula or competitive grants. Performance
    Profiles are available at the national level and by individual grantee. Competitive
    grantees may have multiple grants at a given time, therefore some competitive grantees
    have more than one report per year. For a given year, the most recent quarterly
    report replaces the previous quarterly report. The national HOPWA performance profiles
    represent data as received by HUD HQ. Under the Consolidated Plan process, at the
    end of that program year, formula grantees compile information on housing outputs
    and client outcomes from all project sponsors and submit a HOPWA grantee summary
    (within 90 days) to HUD's area field office and the HQ Office of HIV/AIDS Housing.
    The HOPWA section is also part of their CAPER report that provides public information
    on their formula program accomplishments. Grantees also report related project and
    client data in a HOPWA beneficiary worksheet (pending related enhancements to IDIS
    for this information) on the assistance provided to beneficiaries during this operating
    period. Similarly, HOPWA competitive renewal grants report at the end of each of
    their contract years in Annual Progress Reports (APR). Program operating years vary
    by grant. By contrast, data on expenditures is tracked in a live manner, based on
    current disbursements filed with the Department's accounting systems. Note: Data
    collection and validation actions are pending with some reports. Profiles with no
    data mean that the grantee has yet to submit their performance report.",nt"license_title":
